INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (1, N'Algebra 1', N'ALG1', N'ALG1')

INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (2, N'Algebra 2', N'ALG2', N'This course is designed to build on algebraic and geometric concepts.  It develops advanced algebra skills such as systems of equations, advanced polynomials, imaginary and complex numbers, quadratics, and concepts and includes the study of trinometric functions.  It also introduces matrices and their properties.  The content of this course are important for students’ success on both the ACT and college mathematics entrance exams.')

INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (3, N'Alritmi i strukture u programiranju', N'ASP', N'Course covers analysis and design of fundamental data structures and engages learners to use data structures as tools to alrithmically design efficient computer programs that will cope with the complexity of actual applications.
The course focuses on basic and essential topics in data structures, including array-based lists, linked lists, skiplists, hash tables, recursion, binary trees, scapeat trees, red–black trees, heaps, sorting alrithms, graphs, and binary trie.')

INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (4, N'Statistika', N'STAT', N'STAT 101 is an introductory course in statistics intended for students in a wide variety of areas of study. Topics discussed include displaying and describing data, the normal curve, regression, probability, statistical inference, confidence intervals, and hypothesis tests with applications in the real world. Students also have the opportunity to analyze data sets using technology in their weekly laboratory discussions.')

INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (5, N'Kompjuterske mreže', N'KM', N'This class will cover the theory, design, engineering, and installation of networks to
connect digital computers. The course will prepare students to plan and implement a
network. Also includes peer-to-peer networks, the client-server model, network
operating systems, and an introduction to wide-area networks.')

INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (6, N'Engleski Jezik 1', N'ENG1', N'Razvijanje osnovnih jezičkih vještina, sa posebnim naglaskom na
vornu/komunikacijsku vještinu. Nastavni materijal koji se obrađuje u okviru ovog
predmeta je većim dijelom stručnog - informatičkog sadržaja, u cilju upoznavanja
sa osnovnom terminologijom iz oblasti informacijskih tehnologija i osposobljavanja
studenata za adekvatno korištenje stručne literature na engleskom jeziku.')

INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (7, N'Digitalna Ekonomija', N'DG', N'The digitization of the economy is one of the most critical issues of our time. Digital technologies has transformed businesses and peoples life, and will continue to do so in the future. This course is about digital economics and how the digital economy influences markets and the society. We learn about how the Internet, mobile communications, the sharing economy, social media, and cryptocurrencies impact global businesses.')

INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (8, N'Japanski jezik', N'JPJ', N'Japanese (About this soundlisten)) is an East Asian language spoken by about 128 million people, primarily in Japan, where it is the national language. It is a member of the Japonic (or Japanese-Ryukyuan) language family, and its relation to other languages, such as Korean, is debated. Japonic languages have been grouped with other language families such as Ainu, Austroasiatic, and the now-discredited Altaic, but none of these proposals has gained widespread acceptance.')

INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (9, N'Data Science: R Basics', N'DS-R', N'R is a programming language and free software environment for statistical computing and graphics supported by the R Foundation for Statistical Computing.[6] The R language is widely used among statisticians and data miners for developing statistical software[7] and data analysis.[8] Polls, data mining surveys, and studies of scholarly literature databases show substantial increases in popularity')

INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (10, N'Data Science: Probability', N'DS-P', N'Probability is the branch of mathematics concerning numerical descriptions of how likely an event is to occur or how likely it is that a proposition is true. The probability of an event is a number between 0 and 1, where, roughly speaking, 0 indicates impossibility of the event and 1 indicates certainty.')

INSERT [dbo].[Kurs] ([Id], [Naziv], [SkraceniNaziv], [Opis]) VALUES (11, N'Cryptocurrencies', N'Cryp', N'A cryptocurrency (or crypto currency) is a digital asset designed to work as a medium of exchange wherein individual coin ownership records are stored in a digital ledger or computerized database using strong cryptography to secure transaction record entries, to control the creation of additional digital coin records, and to verify the transfer of coin ownership.[1][2] It typically does not exist in physical form (like paper money) and is typically not issued by a central authority. ')

